import datetime
import logging
from typing import List, Dict, Optional
import requests
import sqlalchemy
from sqlalchemy import create_engine, Column, Integer, String, Index
from sqlalchemy.ext.declarative import declarative_base
from sqlalchemy.orm import sessionmaker
import newrelic.agent
import re

# Database models
Base = declarative_base()

class Submission(Base):
    __tablename__ = 'submissions'
    id = Column(Integer, primary_key=True)
    publish_status = Column(String)
    flexfields = Column(String)
    fsrs_records = Column(String)
    updated_at = Column(String)

class Resource(Base):
    __tablename__ = 'resources'
    id = Column(Integer, primary_key=True)
    name = Column(String)
    url = Column(String)
    style = Column(String)

class DataRecord(Base):
    __tablename__ = 'data_records'
    id = Column(Integer, primary_key=True)
    date = Column(String)
    funding_agency_code = Column(String)
    federal_action_obligation = Column(String)
    duns_number = Column(String)
    action_type = Column(String)
    zip_code = Column(String)
    ppop_code = Column(String)
    office_code = Column(String)
    office_name = Column(String)
    is_deleted = Column(Boolean, default=False)

Index('idx_data_records_date', DataRecord.date)
Index('idx_data_records_duns', DataRecord.duns_number)

# Database setup
engine = create_engine('sqlite:///data.db')
Base.metadata.create_all(engine)
Session = sessionmaker(bind=engine)
session = Session()

# New Relic setup
newrelic.agent.initialize('newrelic.ini')

# Helper functions
def validate_zip_code(zip_code: str) -> bool:
    pattern = r'^\d{5}(-\d{4})?$'
    return bool(re.match(pattern, zip_code))

def validate_duns(duns: str, action_type: str, date: str) -> bool:
    if not duns:
        return action_type in ['TYPE1', 'TYPE2']
    return len(duns) == 9 and duns.isdigit()

def derive_funding_agency_code(record: Dict) -> str:
    return record.get('funding_agency_code', 'DEFAULT')

def derive_office_name(office_code: str) -> str:
    offices = {'OC1': 'Office One', 'OC2': 'Office Two'}
    return offices.get(office_code, 'Unknown Office')

def update_frontend_urls(old_url: str, new_url: str) -> None:
    resource = session.query(Resource).filter_by(url=old_url).first()
    if resource:
        resource.url = new_url
        session.commit()

def generate_d1_file(fpds_data: List[Dict]) -> None:
    for record in fpds_data:
        session.add(DataRecord(**record))
    session.commit()

def process_deletions(date: str) -> None:
    records = session.query(DataRecord).filter_by(date=date).all()
    for record in records:
        record.is_deleted = True
    session.commit()

def update_sql_query(old_query: str, new_query: str) -> None:
    with engine.connect() as conn:
        conn.execute(new_query)

def update_publish_status(submission_id: int, status: str) -> None:
    submission = session.query(Submission).get(submission_id)
    if submission:
        submission.publish_status = status
        session.commit()

def sync_d1_with_fpds(fpds_data: List[Dict]) -> None:
    generate_d1_file(fpds_data)

def update_broker_validation_rules(rule_name: str, new_rule: str) -> None:
    logging.info(f"Updated validation rule {rule_name} to {new_rule}")

def update_landing_page_content(round_id: int, content: str) -> None:
    logging.info(f"Updated landing page for round {round_id}")

def enhance_submission_logging(submission_id: int) -> None:
    logging.info(f"Enhanced logging enabled for submission {submission_id}")

def add_gtas_window_data(data: Dict) -> None:
    session.add(DataRecord(**data))
    session.commit()

def derive_historical_fabs_fields(record_id: int) -> None:
    record = session.query(DataRecord).get(record_id)
    if record:
        record.office_name = derive_office_name(record.office_code)
        session.commit()

def update_sample_file_links(dialog_id: int, new_link: str) -> None:
    logging.info(f"Updated sample file link for dialog {dialog_id}")

def update_submission_dashboard_labels(new_labels: Dict) -> None:
    logging.info("Updated submission dashboard labels")

def schedule_user_testing(test_date: str, participants: List[str]) -> None:
    logging.info(f"Scheduled testing for {test_date} with {len(participants)} participants")

def update_header_with_datetime() -> str:
    return datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S")

def validate_loan_records(record: Dict) -> bool:
    amount = record.get('amount', 0)
    return amount >= 0

def update_file_headers(version: str) -> None:
    logging.info(f"Updated file headers to match schema version {version}")

def update_fabs_file_access(user_id: int, access: bool) -> None:
    logging.info(f"Set FABS file access for user {user_id} to {access}")

def report_user_testing_feedback(agency: str, feedback: str) -> None:
    logging.info(f"Reported feedback to {agency}: {feedback}")

def generate_d_files(request_id: int) -> None:
    logging.info(f"Generated D Files for request {request_id}")

def add_ppopcode_cases(record_id: int, ppop_code: str) -> None:
    record = session.query(DataRecord).get(record_id)
    if record:
        record.ppop_code = ppop_code
        session.commit()

def load_historical_fpds_data(data: List[Dict]) -> None:
    for record in data:
        session.add(DataRecord(**record))
    session.commit()

def exclude_deleted_fsrs(submission_id: int) -> None:
    submission = session.query(Submission).get(submission_id)
    if submission:
        submission.fsrs_records = "active_only"
        session.commit()

def map_federal_action_to_atom_feed(record_id: int) -> None:
    record = session.query(DataRecord).get(record_id)
    if record:
        logging.info(f"Mapped FederalActionObligation {record.federal_action_obligation} to Atom Feed")

def update_validation_rules(rule_name: str, new_rule: str) -> None:
    logging.info(f"Updated validation rule {rule_name} to {new_rule}")

def include_flexfields_in_errors(submission_id: int) -> None:
    submission = session.query(Submission).get(submission_id)
    if submission and not submission.flexfields:
        logging.info("Included flexfields in error file")

def configure_new_relic(app_name: str) -> None:
    newrelic.agent.register_application(name=app_name, timeout=10)

def redesign_resources_page(style_guide: str) -> None:
    resources = session.query(Resource).all()
    for resource in resources:
        resource.style = style_guide
    session.commit()

def update_frontend_navigation(old_path: str, new_path: str) -> None:
    logging.info(f"Updated frontend path from {old_path} to {new_path}")
